Listing.where(vin: '19UYA424X3A007738').first.update(:title=>"2003 Acura CL", :description=>"Our incredible Clean Carfax 2003 Acura CL shown in Desert Mist is eager to please you! The 3.2 Liter VTEC V6 which kicks out a stout 225 horsepower is influenced by the NSX sports car. It's paired with a responsive automatic transmission to reward you with a smooth, yet spirited ride!  Enjoy the assertive appearance of our CL! The grille incorporates a body-colored surround, and the headlights have partially blacked-out reflectors. A more aggressive air intake is installed in the lower bumper, and wheels make it just look perfect in any light! Speaking of Light, the CL coupe comes with xenon high-intensity-discharge headlights.  Slide inside to see the leather trim and dashboard instruments that are backlit. Standard equipment includes an Acura/Bose stereo system with an in-dash six-CD player, automatic climate control and heated front seats. The driver gets an eight-way power seat, while the front passenger's seat is a four-way unit. Did you see the sunroof?  Dual-stage, dual-threshold front airbags and all-disc ABS are standard. Side-impact airbags have height and position sensors. LATCH child-safety seat anchors and tethers have been added to the outboard rear seats. Yes, this is a beautiful machine that is safe, stylish and practically calling your name! So enough already... Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.  10 DAYS ONLY! CASH SPECIAL NOW ONLY $5,370. 2003 Acura 3.2 CL Coupe Super nice. Only 92,000 actual miles \u00C2\u00A0 Free 2 year Maintenance Plan Sweet Ride!   Cash price expires 5/12/18", :city=>"NOT LISTED", :state=>"NOT LISTED", :zipcode=>nil, :category_id=>nil, :subcategory_id=>nil, :latitude=>nil, :longitude=>nil, :user_id=>1072, :image=>nil, :year=>2003, :miles=>92431, :transmission=>"Autom