Listing.where(vin: '1GNEC16Z23J205219').first.update(:title=>"2003 Chevrolet Suburban", :description=>"Our Clean Carfax 2003 Chevrolet Suburban LS displayed in Sandalwood Metallic offers a cavernous interior with seats that fold down for monster cargo loads. It's based on an excellent full-size truck frame and its 5.3 Liter V8 delivers strong torque for towing heavy loads when mated to the Automatic transmission. This Rear Wheel Drive Suburban provides a stable, comfortable ride for long-distance travel and near 20mpg on the open road.   This is a great vehicle for moving cargo, towing trailers, or hauling people. It's best when employed for all three of those things. Plus, with the abundance of amenities inside, you'll be singing its praises for years to come. Multi-zone climate control keeps the cabin a comfy oasis while the creature comforts such as cruise control, keyless entry, power door locks/windows, and tinted windows keep you in the modern age. So slide into the supportive seats, grip the leather steering wheel, and get ready to take an adventure!  Chevrolet's passion for safety shines through in their equipment list. Daytime running lights let you see any obstacle, four-wheel ABS grant you confidence, while dual-stage front airbags provide improved safety in an accident. This Suburban sure to impress you! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", :city=>"NOT LISTED", :state=>"NOT LISTED", :zipcode=>nil, :category_id=>nil, :subcategory_id=>nil, :latitude=>nil, :longitude=>nil, :user_id=>1072, :image=>nil, :year=>2003, :miles=>121974, :transmission=>"Automatic", :color=>"Sandalwood Metallic", :cylinder=>"NOT LISTED", :fuel=>"Gasoline", :drive=>"2WD", :address=>nil, :wholesale=>false, :price=>7999, :newused=>"Used", :vin=>"1GNEC16Z23J205219", :stocknumber=>"DCSN188", :model=>"Suburban", :trim=>"