Listing.where(vin: '1FMFU17L53LA56714').first.update(:title=>"2003 Ford Expedition", :description=>"For people who needed three rows of seats like a minivan but want to trade the soccer-mom image for the rugged, outdoorsy appearance of an SUV, our '03 Expedition is an excellent option.\u00C2\u00A0 This RWD is powered by a big 5.4L V8 engine. The suspension, combined with a stiffer chassis, gives the Expedition dramatically improved ride and handling. It makes the Expedition feel far smaller than the large vehicle it is. A driver could comfortably stay behind the wheel for the entire trip without fatigue. The steering is more responsive and more stable on the open road.   Climb aboard our Eddie Bauer trimmed Expedition and you'll immediately notice the luxurious leather seating, CD changer, power seats, and more!\u00C2\u00A0 Take a look at our pictures!\u00C2\u00A0 Add in safety features like ABS, and plenty of airbags and you can rest assured that you and your family are well protected.  This SUV sacrifices none of its large truck-like capabilities but adds more car-like ride and handling along with some very convenient and clever features. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership!", :city=>"NOT LISTED", :state=>"NOT LISTED", :zipcode=>nil, :category_id=>nil, :subcategory_id=>nil, :latitude=>nil, :longitude=>nil, :user_id=>1072, :image=>nil, :year=>2003, :miles=>165299, :transmission=>"Automatic", :color=>"Maroon", :cylinder=>"NOT LISTED", :fuel=>"Gasoline", :drive=>"2WD", :address=>nil, :wholesale=>false, :price=>4990, :newused=>"Used", :vin=>"1FMFU17L53LA56714", :stocknumber=>"IAUJ67", :model=>"Expedition", :trim=>"Rear Wheel Drive", :enginedescription=>"5.4L 8 Cylinders", :interiorcolor=>"Tan", :options=>"Air Conditioning : Multi-Zone A/C,Air Conditioning : Rear A/C,Audio : Am/Fm Stereo,Audio : Cd Changer,Audio : Cd Player,Audio : Premium Sound System,Audio : Rear Seat Audio Controls,Convenience : Luggage Rack,Co