Listing.where(vin: '1FMZU63P71ZA19869').first.update(:title=>"2001 Ford Explorer", :description=>"Look at our Clean Carfax 2001 Explorer XLT displayed in Black! This Rear Wheel Drive gets up and goes and can hit 60 from a standstill in no time with its 5.0L V8! But there is more than just quick times that makes this vehicle so fun and that's the smooth shifting transmission keeps the engine on the power curve. The way this thing loves to rev it almost gives you the feeling of driving a sports car! The freeway shows off the long legs of this Explorer. Smooth, quiet and relaxed are adjectives that make this Explorer a great highway cruiser/hauler. Bigger bumps are absorbed like a sponge.   The interior reflects its midsized SUV status and includes leather seats and a sunroof. It offers generous dimensions in front and rear leg, shoulder and headroom and a large rear cargo area. So load up the family, tents, backpacks, and all your gear! This one is ready to take you to the camp site!   This die-hard Built Ford Tough Explorer is going to make someone very happy. Why not make it you? Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", :city=>"NOT LISTED", :state=>"NOT LISTED", :zipcode=>nil, :category_id=>nil, :subcategory_id=>nil, :latitude=>nil, :longitude=>nil, :user_id=>1072, :image=>nil, :year=>2001, :miles=>108286, :transmission=>"Automatic", :color=>"Black", :cylinder=>"NOT LISTED", :fuel=>"Gasoline", :drive=>"2WD", :address=>nil, :wholesale=>false, :price=>4895, :newused=>"Used", :vin=>"1FMZU63P71ZA19869", :stocknumber=>"DCSJ078", :model=>"Explorer", :trim=>"Rear Wheel Drive", :enginedescription=>"5L 8 Cylinders", :interiorcolor=>"Medium Graphite", :options=>"(3) Grab Handles,(4) Load Floor Tie-Down Hooks,12-Volt Pwr Point,5-Passenger Seating,Air Conditioning : Rear A/C,Audio : Cd Player,Audio : Rear Seat Aud