Listing.where(vin: '1FAHP3FN2AW198619').first.update(:title=>"2010 Ford Focus", :description=>"Our One Owner, Clean CarFax 2010 Ford Focus SE FWD in Silver over Grey interior handles nicely, offers comfortable and supportive front seating, and saves money at the pump. This sporty little compact gets the job done! Under the hood lies a 2.0 Liter 4 Cylinder delivering 140hp. Coupled with a smooth shifting Automatic, our Front Wheel Drive scores a gas-sipping 35mpg on the highway, plus passing and merging on the highway are pretty zippy as well.\u00C2\u00A0   The interior of the SE trim receives its share of attention - sleek design abounds and everything a driver needs is within easy reach. Check out our pictures! Commuters and RVers looking for a pull-behind car will be pleased with the sound system that includes CD/MP3/SAT and auxiliary input, cruise on the steering wheel, key-less entry, power accessories, and more.\u00C2\u00A0   All the Ford safety features you expect are in place to keep you safe and secure on the road. We love the all-around performance of this Ford Focus sedan and know you will, too! Go ahead, take another look at our pictures of this sweet Focus and picture yourself behind the wheel! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", :city=>"NOT LISTED", :state=>"NOT LISTED", :zipcode=>nil, :category_id=>nil, :subcategory_id=>nil, :latitude=>nil, :longitude=>nil, :user_id=>1072, :image=>nil, :year=>2010, :miles=>82388, :transmission=>"Automatic", :color=>"Ingot Silver Metallic", :cylinder=>"NOT LISTED", :fuel=>"Gasoline", :drive=>"2WD", :address=>nil, :wholesale=>false, :price=>5999, :newused=>"Used", :vin=>"1FAHP3FN2AW198619", :stocknumber=>"ACSJ198", :model=>"Focus", :trim=>"Front Wheel Drive", :enginedescription=>"2L 4 Cylinders", :interiorcolor=>"Charcoal Black", :options=>"3-Point Fro