Listing.where(vin: '1FAFP40483F377067').first.update(:title=>"2003 Ford Mustang", :description=>"Our Clean Carfax 2003 Ford Mustang V6 Coupe shown in Redfire Metallic already has a vivacious engine and adept handling abilities that will please more performance-oriented buyers but you will have to slide behind the wheel to grasp the true power, the soft ride, and the pleasant feel. Its 3.8 Liter V6 offers 195hp and is mated to an agile Automatic transmission making this Rear Wheel Drive Coupe a powerful ride! The stance is wide and low and you will notice yourself turning heads as you drive by while earning 27mpg on the open road.   Slide into the aggressive cabin that is full of all the creature comforts you've come to expect in a Ford from this Millennia. Air conditioning, keyless entry, power door locks/windows, and a stellar sound system complete with an AM/FM radio and a CD player will keep you sitting in the lap of luxury in the modern age.   Rest assured that you and your loved ones will be kept out of harm's way with features such as child seat tethers, standard three-point seat belts, and a fleet of airbags. This sleek and seductive Mustang is going to be the talk of your neighborhood, so don't delay. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", :city=>"NOT LISTED", :state=>"NOT LISTED", :zipcode=>nil, :category_id=>nil, :subcategory_id=>nil, :latitude=>nil, :longitude=>nil, :user_id=>1072, :image=>nil, :year=>2003, :miles=>69586, :transmission=>"Automatic", :color=>"Redfire Metallic", :cylinder=>"NOT LISTED", :fuel=>"Gasoline", :drive=>"2WD", :address=>nil, :wholesale=>false, :price=>6895, :newused=>"Used", :vin=>"1FAFP40483F377067", :stocknumber=>"ECSJ028", :model=>"Mustang", :trim=>"Rear Wheel Drive", :enginedescription=>"3.8L 6 Cylinders", :interiorcolor=>"Dark Charcoal", :options=>"Air Conditi