Listing.where(vin: '1FTYR14V83PA16396').first.update(:title=>"2003 Ford Ranger", :description=>"Meet our 2003, Clear Carfax, Ford Ranger. Some of us still remember when pickup trucks primarily hauled lumber, sand, and fertilizer. They do that better than ever. But to succeed today, a pickup also has to haul attitude. Fortunately, Ford's compact Ranger can haul just about anything with ease.   Our 2003 Ranger is even more quiet, thanks to thicker glass, new door and B-pillar seals and a new drive shaft tunnel insulator shield. This little baby comes with an AM/FM stereo, and vinyl upholstery. Ford Ranger has consistently set the standard among compact trucks for spacious, comfortable accommodations and convenient features.   One more reason this truck is a good value. For a growing number of individuals, even young families, a compact pickup is a sensible choice. This truck can be a versatile weekend workhorse! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership!", :city=>"NOT LISTED", :state=>"NOT LISTED", :zipcode=>nil, :category_id=>nil, :subcategory_id=>nil, :latitude=>nil, :longitude=>nil, :user_id=>1072, :image=>nil, :year=>2003, :miles=>154575, :transmission=>"Automatic", :color=>"Gold", :cylinder=>"NOT LISTED", :fuel=>"Gasoline", :drive=>"2WD", :address=>nil, :wholesale=>false, :price=>5999, :newused=>"Used", :vin=>"1FTYR14V83PA16396", :stocknumber=>"JCSJ157", :model=>"Ranger", :trim=>"Rear Wheel Drive", :enginedescription=>"3L 6 Cylinders", :interiorcolor=>"Gray", :options=>"Adjustable Height Front Shoulder Safety Belts W/Top Release,Air Bag - Frontal : Driver Air Bag,Air Bag - Frontal : Passenger Air Bag,Air Bag - Frontal : Passenger Air Bag On/Off Switch,Audio : Am/Fm Stereo,Child Safety Seat Restraint Latches (Latch),Convenience : Engine Immobilizer,Convenience : Intermittent Wipers,Convenience : Power Outlet,Driver & Front Passenger Airbags W/Manual Passenger-Side Deactivation Switch,Driver/Passenger-Side A-Pillar-