Listing.where(vin: '5J6RE3H3XAL039603').first.update(:title=>"2010 Honda CR-V", :description=>"You'll appreciate the way our Clean Carfax 2010 Honda CR-V, displayed in Tango Red Pearl gives you the handling characteristics of a car, yet retains the high seating position and excellent visibility of a large SUV! This Front Wheel Drive machine is powered by a fuel efficient 2.4 Liter 4 Cylinder mated to an automatic transmission for plenty of get up and go! This 4 Cylinder revs quickly and offers lots of passing power and still gets great gas mileage! This SUV is the perfect commuter for any situation from handling the trip to grandmas or the golf course... Hitting up garage sales or taking laundry home from the dorm.   Our CR-V LX comes with an AM/FM/CD stereo with speed-sensitive volume control, cloth reclining seats, an air-filtration system, and more, just look at the pictures and imagine yourself behind the wheel!   After only a short test drive, you'll conclude that this CR-V is exactly what you've been searching for! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", :city=>"NOT LISTED", :state=>"NOT LISTED", :zipcode=>nil, :category_id=>nil, :subcategory_id=>nil, :latitude=>nil, :longitude=>nil, :user_id=>1072, :image=>nil, :year=>2010, :miles=>103353, :transmission=>"Automatic", :color=>"Tango Red Pearl", :cylinder=>"NOT LISTED", :fuel=>"Gasoline", :drive=>"2WD", :address=>nil, :wholesale=>false, :price=>10999, :newused=>"Used", :vin=>"5J6RE3H3XAL039603", :stocknumber=>"DCSJ018", :model=>"CR-V", :trim=>"Front Wheel Drive", :enginedescription=>"2.4L 4 Cylinders", :interiorcolor=>"Gray", :options=>"12V Pwr Outlets -Inc: Front & Rear,Anti-Lock Braking System (Abs) W/Electronic Brake Distribution (Ebd),Audio : Auxiliary Audio Input,Audio : Cd Player,Audio : Mp3 Player,Convenience : Power Outlet,Front Side-Impa