Listing.where(vin: 'JHLRD68524C009532').first.update(:title=>"2004 Honda CR-V", :description=>"Take a good look at our One Owner Clean Carfax 2004 Honda CR-V LX presented in Satin Silver Metallic. Powered by a 2.4 Liter 4 Cylinder that offers 160hp while connected to a 4 Speed Automatic transmission. This Front Wheel Drive SUV has the combination for a great ride for you and the family while getting 26mpg on the highway.   As shown in our pictures, our CR-V LX has loads of features to make every trip more enjoyable. You'll love the power windows and locks, cruise control, tilt steering wheel and the cloth seats that hold you in place with comfort. Plus an AM/FM/CD stereo is aboard, too.  Honda has a great reputation for safety thanks to features like dual front airbags to keep you and your family from harm. Whether it's running errands, shuttling kids, or facing a daunting commute, our CR-V LX can handle it. No doubt, this CR-V LX is a great vehicle to have! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", :city=>"NOT LISTED", :state=>"NOT LISTED", :zipcode=>nil, :category_id=>nil, :subcategory_id=>nil, :latitude=>nil, :longitude=>nil, :user_id=>1072, :image=>nil, :year=>2004, :miles=>153441, :transmission=>"Automatic", :color=>"Satin Silver Metallic", :cylinder=>"NOT LISTED", :fuel=>"Gasoline", :drive=>"2WD", :address=>nil, :wholesale=>false, :price=>6370, :newused=>"Used", :vin=>"JHLRD68524C009532", :stocknumber=>"CASJ108", :model=>"CR-V", :trim=>"Front Wheel Drive", :enginedescription=>"2.4L 4 Cylinders", :interiorcolor=>"Saddle", :options=>"Air Conditioning W/Micron Air Filtration System,Audio : Cd Player,Childproof Rear Door Locks,Convenience : Power Outlet,Driver & Front Passenger Airbags (Srs),Driver & Front Passenger Side-Impact Airbags-Inc: Passenger-Side Occupant Position Detection System (Opds),Fron