Listing.where(vin: '1J4PR4GK4AC158967').first.update(:title=>"2010 Jeep Grand Cherokee", :description=>"The perfect combination of sport utility, fuel economy, and comfort, our 2010 Jeep Grand Cherokee Laredo 4x4 shown in Bright Silver Metallic in is an ideal choice for you and your active lifestyle! This incredible Four wheel Drive Cherokee is powered by a responsive 3.7 Liter V6 that kicks out 210hp. Paired with a 5 Speed Automatic transmission, it holds plenty of power and rewards you with near 21mpg on the open road.  Take a look at our photos to see the impeccable condition of this Grand Cherokee Laredo. It is equipped with endless features that will satisfy even the most skeptical driver. Privacy glass, heated mirrors, AM/FM/CD/MP3, available satellite radio, power accessories, key-less entry, steering wheel audio controls and more make every ride feel first class! There's plenty of room inside, with split folding rear seats to offer ample storage so you can go wherever your heart desires.  Rest-assured that you and your passengers are safe thanks to the variety of airbags, enhanced accident response system, electronic stability control, and a tire pressure monitor system. You're going to love driving this Laredo, and you'll look great behind the wheel! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", :city=>"NOT LISTED", :state=>"NOT LISTED", :zipcode=>nil, :category_id=>nil, :subcategory_id=>nil, :latitude=>nil, :longitude=>nil, :user_id=>1072, :image=>nil, :year=>2010, :miles=>103384, :transmission=>"Automatic", :color=>"Bright Silver Metallic", :cylinder=>"NOT LISTED", :fuel=>"Gasoline", :drive=>"2WD", :address=>nil, :wholesale=>false, :price=>11999, :newused=>"Used", :vin=>"1J4PR4GK4AC158967", :stocknumber=>"DCSN128", :model=>"Grand Cherokee", :trim=>"Four Wheel Drive", :enginedescription=>"3.7L 6 C