Listing.where(vin: '1J4PN2GKXBW557009').first.update(:title=>"2011 Jeep Liberty", :description=>"Our Clean Carfax 2011 Jeep Liberty Sport 4x4, shown in Dark Charcoal Pearl is a great compact SUV and an awesome buy! It is built well, rides comfortably, is - of course - off-road capable, and offers an all around fun and pleasant driving experience. Our Liberty starts with a 3.7 Liter V6 paired with an upgraded 4 Speed Automatic transmission. This Jeep is ready to jump in the mud and show off its off-road capabilities with the Jeep Command Trac 4WD system!   Inside, you will take notice of the spaciousness and outstanding driver functionality. Our Sport trim stands tall on features. Try out the power accessories, crank up your own tunes on the 6-speaker audio system with auxiliary input, and adjust the steering wheel to your comfort position. Did you see the Sunroof?  Electronic stability, ABS with brake assist, and plenty of airbags are in place to keep you and yours secure. This SUV is not something you want to pass up! You could be just minutes away from sitting back and enjoying your Jeep Liberty. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", :city=>"NOT LISTED", :state=>"NOT LISTED", :zipcode=>nil, :category_id=>nil, :subcategory_id=>nil, :latitude=>nil, :longitude=>nil, :user_id=>1072, :image=>nil, :year=>2011, :miles=>101301, :transmission=>"Automatic", :color=>"Dark Charcoal Pearl", :cylinder=>"NOT LISTED", :fuel=>"Gasoline", :drive=>"2WD", :address=>nil, :wholesale=>false, :price=>10999, :newused=>"Used", :vin=>"1J4PN2GKXBW557009", :stocknumber=>"CCSN148", :model=>"Liberty", :trim=>"Four Wheel Drive", :enginedescription=>"3.7L 6 Cylinders", :interiorcolor=>"Dark Slate Gray Interior", :options=>"\"Flipper\" Liftgate Glass,Air Bag - Frontal : Driver Air Bag,Audio : Auxiliary Audio Input,Audio : Cd Playe