Listing.where(vin: '1LNHM86S95Y621157').first.update(:title=>"2005 Lincoln LS", :description=>"Whether it's the powerful V6, the rear-wheel drive ride and handling, or the elegant styling inside and out that caught your attention, this One Owner 2005 Lincoln LS is a great option if you're shopping for an upscale sedan in this price range. There's just so much to like here.....  Inside, you might guess you were in a European car - there are no gaudy trim pieces or large cushy armchair-style seats. Instead the interior is classy, understated, and refined. Our V6 sedan includes leather seats with heated front seats, passenger climate control, and so much more! Take a good look at our pictures of this lovely LS! \u00C2\u00A0 With all it has to offer, this LS is a viable alternative to a BMW for a driver who wants a luxury sedan but doesn't want to spend unnecessary bucks to get one. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership!", :city=>"NOT LISTED", :state=>"NOT LISTED", :zipcode=>nil, :category_id=>nil, :subcategory_id=>nil, :latitude=>nil, :longitude=>nil, :user_id=>1072, :image=>nil, :year=>2005, :miles=>110277, :transmission=>"Automatic", :color=>"Silver Birch Metallic", :cylinder=>"NOT LISTED", :fuel=>"Gasoline", :drive=>"2WD", :address=>nil, :wholesale=>false, :price=>4990, :newused=>"Used", :vin=>"1LNHM86S95Y621157", :stocknumber=>"ACSJ98", :model=>"LS", :trim=>"Rear Wheel Drive", :enginedescription=>"3L 6 Cylinders", :interiorcolor=>"Gray", :options=>"Air Conditioning : Multi-Zone A/C,Audio : Am/Fm Stereo,Audio : Cd Changer,Audio : Cd Player,Automatic Dual Zone Climate Control W/Air Filtration System,Child-Proof Rear Door Locks,Convenience : Power Outlet,Convenience : Security System,Locks : Keyless Entry,Locks : Power Door Locks,Perimeter Anti-Theft Alarm System-Inc: Led Indicator,Pwr Windows W/Driver/Passenger One Touch Up/Down,Side Airbags For Driver & Front Passenger,Window : Power Windows,Window : Rear Defrost