Listing.where(vin: 'WMWMM335X9TP91063').first.update(:title=>"2009 MINI Cooper Clubman", :description=>"An incredibly great time awaits you in our highly desirable 2009 MINI Cooper Clubman on display in ravishing Laser Blue Metallic. Under the hood of this spirited four-passenger, hatchback is a surprisingly responsive 1.6 Liter 4 Cylinder that cranks out 118hp on demand while paired with a 6 Speed Steptronic Automatic transmission. This efficient team allows our Cooper to score 5.7L/100km on the open road while offering entertaining driving dynamics and quick handling.  As you can see from our photos, the unique retro design of our Clubman will certainly turn heads. Inside, you'll appreciate such conveniences as keyless entry, full power accessories, a trip computer, Bluetooth and a sunroof. Settle into comfortable heated leatherette seating and enjoy the ample legroom, and a tilt-and-telescoping leather-wrapped multi-function steering wheel as you crank up an impressive audio system.  Anti-lock disc brakes, front-seat side airbags, full-length side curtain airbags and stability control are all on board to keep you out of harm's way as you travel in this fantastic Cooper Clubman. Care-free, fun and eager-to-please, this spirited traveling partner awaits you! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", :city=>"NOT LISTED", :state=>"NOT LISTED", :zipcode=>nil, :category_id=>nil, :subcategory_id=>nil, :latitude=>nil, :longitude=>nil, :user_id=>1072, :image=>nil, :year=>2009, :miles=>78296, :transmission=>"Automatic", :color=>"Laser Blue Metallic", :cylinder=>"NOT LISTED", :fuel=>"Gasoline", :drive=>"2WD", :address=>nil, :wholesale=>false, :price=>8995, :newused=>"Used", :vin=>"WMWMM335X9TP91063", :stocknumber=>"CNSJ158", :model=>"Cooper Clubman", :trim=>"Front Wheel Drive", :enginedescription=>"1.6L 4 Cylin