Listing.where(vin: '3N1CB51D86L565732').first.update(:title=>"2006 Nissan Sentra", :description=>"With power, performance, and premium features, our Clean Carfax 2006 Nissan Sentra 1.8 S Sedan displayed in Sunburst is a terrific choice to be your newest traveling companion! Beneath the hood is a 126hp 1.8 Liter 4 Cylinder and smooth-shifting 4 Speed Automatic transmission. Expect near 34mpg on the highway and a comfortable ride that will keep a smile on your face.  Our Sentra 1.8 S looks sporty and ready to roll with its sleek contours and privacy glass. The spacious cabin takes great care of you with supportive seating, power accessories, AM/FM/CD audio, and more!  You'll certainly appreciate all that our Sentra has to offer and will drive confidently with safety features that have been carefully crafted to help you avoid and manage challenging driving situations. Get behind the wheel of our Sentra and see what it can do for you! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", :city=>"NOT LISTED", :state=>"NOT LISTED", :zipcode=>nil, :category_id=>nil, :subcategory_id=>nil, :latitude=>nil, :longitude=>nil, :user_id=>1072, :image=>nil, :year=>2006, :miles=>106982, :transmission=>"Automatic", :color=>"Sunburst", :cylinder=>"NOT LISTED", :fuel=>"Gasoline", :drive=>"2WD", :address=>nil, :wholesale=>false, :price=>4999, :newused=>"Used", :vin=>"3N1CB51D86L565732", :stocknumber=>"DCSJ118", :model=>"Sentra", :trim=>"Front Wheel Drive", :enginedescription=>"1.8L 4 Cylinders", :interiorcolor=>"Charcoal", :options=>"8-Way Manual Adjustable Driver Seat,Air Conditioning,Audio : Am/Fm Stereo,Audio : Cd Player,Convenience : Power Outlet,Convenience : Remote Trunk Release,Locks : Keyless Entry,Locks : Power Door Locks,Pwr Windows W/Driver One-Touch Auto Down,Seats : Bucket Seats,Seats : Pass-Through Rear Seat,Seats : Rear 