Listing.where(vin: '1G8ZP1286XZ299702').first.update(:title=>"1999 Saturn SC 3dr", :description=>"Meet our great looking 1999 Saturn S-Series SC in Silver over light interior and find it to be an exceptional 3 Door Coupe. Powered by an efficient 1.9 Liter 4 Cylinder that offers 100hp for robust passing power while connected to a fun to drive Automatic transmission. This Twin Cam Front Wheel Drive Saturn will get you to your destination with ease thanks to variable effort steering and a sporty suspension.   Inside this SC find comfortable bucket seating, easy to read gauges, a rocking AM/FM stereo, power steering, adjustable steering wheel.   Packed full of safety features from General Motors, this Saturn is ready to work for you. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.\u00C2\u00A0 10 DAYS ONLY! CASH SPECIAL NOW ONLY $3,490. 1999 Saturn SC 3\u00C2\u00A0Door\u00C2\u00A0Coupe. Only 84,000 Actual Miles Drives\u00C2\u00A0Great- Super Gas\u00C2\u00A0Saver\u00C2\u00A0\u00C2\u00A0 Free 2 year Maintenance Plan     Cash price expires 5/12/18", :city=>"NOT LISTED", :state=>"NOT LISTED", :zipcode=>nil, :category_id=>nil, :subcategory_id=>nil, :latitude=>nil, :longitude=>nil, :user_id=>1072, :image=>nil, :year=>1999, :miles=>84841, :transmission=>"Automatic", :color=>"Gray", :cylinder=>"NOT LISTED", :fuel=>"Gasoline", :drive=>"2WD", :address=>nil, :wholesale=>false, :price=>3490, :newused=>"Used", :vin=>"1G8ZP1286XZ299702", :stocknumber=>"AASJ108", :model=>"SC 3dr", :trim=>"Front Wheel Drive", :enginedescription=>"1.9L 4 Cylinders", :interiorcolor=>"Gray", :options=>"3-Way Dome Light,60/40 Split Fold-Down Rear Seatbacks,Convenience : Adjustable Steering Wheel,Convenience : Intermittent Wipers,Heat/Ventilation System W/4-Speed Fan, Defroster,Instrument Panel Gauges-Inc: 110 Mph Speedometer W/Trip Odometer, 7000 Rpm T