Listing.where(vin: '3GSDL93718S564285').first.update(:title=>"2008 Saturn VUE", :description=>"While the Saturn Vue Red Line might be meant for civilized roads, you can still run wild in this SUV. The Red Line's 3.6-liter V6 engine fills the need of those who want to dust the wolf packs of meandering mommy-mobiles on the freeway. And with 257 horsepower, this Vue can easily escape boxed-in traffic situations. Ours adds in All Wheel Drive for any tough situation.  Our '08 Vue Red Line has an aggressive attitude.\u00C2\u00A0 The Red Line's sleek exterior style is echoed within the cabin as well,\u00C2\u00A0 Everything is sporty and a bit more special. Take a look at our pictures and you will notice ours even has leather seating and heated front seats.  Our 2008 Saturn Vue Red Line brings more sport and more style. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership!", :city=>"NOT LISTED", :state=>"NOT LISTED", :zipcode=>nil, :category_id=>nil, :subcategory_id=>nil, :latitude=>nil, :longitude=>nil, :user_id=>1072, :image=>nil, :year=>2008, :miles=>125779, :transmission=>"Automatic", :color=>"Techno Gray", :cylinder=>"NOT LISTED", :fuel=>"Gasoline", :drive=>"2WD", :address=>nil, :wholesale=>false, :price=>6470, :newused=>"Used", :vin=>"3GSDL93718S564285", :stocknumber=>"HCSJ137", :model=>"VUE", :trim=>"All Wheel Drive", :enginedescription=>"3.6L 6 Cylinders", :interiorcolor=>"Black", :options=>"Audio : Am/Fm Stereo,Audio : Auxiliary Audio Input,Audio : Cd Player,Audio : Mp3 Player,Audio : Satellite Radio,Convenience : Automatic Headlights,Convenience : Intermittent Wipers,Locks : Keyless Entry,Safety Features : Stability Control,Safety Features : Traction Control,Seats : Heated Front Seat(S),Seats : Power Driver Seat,Window : Power Windows,Window : Privacy Glass,Window : Rear Defrost", :imagefront=>nil, :imageback=>nil, :imageleft=>nil, :imageright=>nil, :frontinterior=>nil, :rearinterior=>nil, :bodytype=>nil, :make=>"Saturn", :ap