Listing.where(vin: '5GZCZ53406S807886').first.update(:title=>"2006 Saturn VUE", :description=>"Our Clean Carfax 2006 Saturn VUE in Polar White stands tall and serves up some stiff competition in the compact SUV market! This SUV is roomy and practical and one-ups the others with unique styling, high quality interior finishes, and additional options not offered by others in this price range. Under the hood sits a 3.5 Liter V6 engine kicking out an impressive 250hp. Paired with a 5-Speed automatic, our Front Wheel Drive is super-enjoyable to drive!  The VUE's comfy front bucket seats and a reclining rear bench seat make this a perfect ride fit for five, and gives your rear passengers plenty of legroom. It even has enough room to haul an 8 foot ladder! Take a look at our photos and see just how nicely appointed this immaculate VUE is, sporting an auto-dimming rearview mirror, power accessories, telematics, fingertip controls on the leather-wrapped wheel, wood grain trim, a rockin' audio system with CD player and auxiliary input, and much more. Your needed safety features are all in place, too.  This is a GREAT SUV for the money and is going to make one lucky person very happy! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", :city=>"NOT LISTED", :state=>"NOT LISTED", :zipcode=>nil, :category_id=>nil, :subcategory_id=>nil, :latitude=>nil, :longitude=>nil, :user_id=>1072, :image=>nil, :year=>2006, :miles=>135160, :transmission=>"Automatic", :color=>"Polar White", :cylinder=>"NOT LISTED", :fuel=>"Gasoline", :drive=>"2WD", :address=>nil, :wholesale=>false, :price=>5995, :newused=>"Used", :vin=>"5GZCZ53406S807886", :stocknumber=>"ECSJ048", :model=>"VUE", :trim=>"Front Wheel Drive", :enginedescription=>"3.5L 6 Cylinders", :interiorcolor=>"Grey", :options=>"Air Conditioning : A/C,Audio : Cd Player,Convenience : Leather S