Listing.where(vin: 'JTEZT17R178012108').first.update(:title=>"2007 Toyota 4Runner", :description=>"Our Clean Carfax 2007 Toyota 4Runner Limited in Titanium Metallic is\u00C2\u00A0 highly capable whether on the pavement or in the dirt. Our Rear Wheel Drive 4Runner 4.7 Liter V8 connected to an Automation Transmission and is a well-rounded midsized SUV, and should be one of the finalists on your short list. If your weekend involves driving over rugged terrain, this 4Runner is an excellent choice. Yet it's smooth and quiet and highly sophisticated in terms of technology and features.  This 4Runner is the real deal, ready to tackle truly rugged terrain. This is no car-based crossover station wagon deal. It offers better recreational capability and long-term durability in working-truck conditions. Inside it's roomy and comfortable with sports leather seats,\u00C2\u00A0 sunroof, and Navigation!  While the 4Runner may seem old school to people who want an all-weather sport touring vehicle, it's the hot ticket for outdoor enthusiasts for its ability to deal with primitive roads, beat-up two-tracks or serious mud or sand. Own this one today and pick your adventure! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", :city=>"NOT LISTED", :state=>"NOT LISTED", :zipcode=>nil, :category_id=>nil, :subcategory_id=>nil, :latitude=>nil, :longitude=>nil, :user_id=>1072, :image=>nil, :year=>2007, :miles=>144764, :transmission=>"Automatic", :color=>"Titanium Metallic", :cylinder=>"NOT LISTED", :fuel=>"Gasoline", :drive=>"2WD", :address=>nil, :wholesale=>false, :price=>12999, :newused=>"Used", :vin=>"JTEZT17R178012108", :stocknumber=>"DNSN208", :model=>"4Runner", :trim=>"Rear Wheel Drive", :enginedescription=>"4.7L 8 Cylinders", :interiorcolor=>"Stone", :options=>"Air Conditioning : Multi-Zone A/C,Audio : Cd Changer,Convenience : Carg