Listing.where(vin: 'JTEHD20V346013807').first.update(:title=>"2004 Toyota RAV4", :description=>"Our One Owner Clean Carfax 2004 Toyota RAV4 4WD stands out from the rest of the pack in Flint Mica! With our Rav4, enjoy the versatility and cargo capacity of an SUV, with the driving dynamics of a sportier sedan and the fuel efficiency of a compact car. Our Four Wheel Drive RAV4 gets its power from the 2.4 Liter 4 Cylinder that lets you use 161hp every day! All this power doesn't mean you'll pay extra at the pump... our fun to drive 5 Speed Manual Rav4 gets nearly 27mpg on the open road, one of the best in the subcompact SUV class!  The interior features comfortable seating, AM/FM Cassette Stereo with CD Player, power accessories, a leather-wrapped steering wheel with mounted audio controls, sunroof and keyless entry. The spacious cargo area is perfect for your gear or groceries.   You will have the piece of mind with all of the standard safety features on board the keep you secure on the road. Our RAV4 is nice in more ways than you can imagine! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", :city=>"NOT LISTED", :state=>"NOT LISTED", :zipcode=>nil, :category_id=>nil, :subcategory_id=>nil, :latitude=>nil, :longitude=>nil, :user_id=>1072, :image=>nil, :year=>2004, :miles=>169910, :transmission=>"Manual", :color=>"Flint Mica", :cylinder=>"NOT LISTED", :fuel=>"Gasoline", :drive=>"2WD", :address=>nil, :wholesale=>false, :price=>6999, :newused=>"Used", :vin=>"JTEHD20V346013807", :stocknumber=>"DCSJ088", :model=>"RAV4", :trim=>"Four Wheel Drive", :enginedescription=>"2.4L 4 Cylinders", :interiorcolor=>"Dark Charcoal", :options=>"3-Point Seat Belts For All Seating Positions,Air Conditioning W/Air Filtration,Audio : Cd Player,Child Restraint System (Crs) Top Tether Anchors For All Rear Seating Positions,Convenience : Powe