Listing.where(vin: '1C4BJWFG2EL127495').first.update(:title=>"2014 Jeep Wrangler Unlimited", :description=>"Take a look at our Terrain Busting One Owner, Clean CarFax 2014 Jeep Wrangler Unlimited Rubicon 4WD shown in a Billet Silver Metallic Clear Coat paint scheme with a Black interior. Under the hood sits a powerful 3.6 Liter V6 that produces 285hp and almost as much torque. Combined with the rock-solid Dana front and rear axles, this 5 Speed Automatic transmission will allow you to maintain civility or allow you to carve your own path where ever you see fit thanks to the locking differentials, Rock-Trac HD transfer case and gas charged shocks. This Four Wheel Drive will achieve 21mpg on the highway. The exterior is highlighted with black wheels, tow hooks and a trailer towing package. The Rubicon goes a little beyond basic by offering Air Conditioning, keyless entry, embroidered seats, power windows/locks, and special badging. With city streets and freeways providing an increasingly unfriendly atmosphere to standard, car-based suspensions, large BFGoodrich mud tires and real ground clearance are increasingly handy for the committed urbanite. If you get the urge to take an open-air cruise, just remove the top, put on some shades, crank up the seven Alpine speaker sound system, and hit the road! A strong safety cage surrounds you, multistage airbags protect you, and Hill-start and stability control help you along the way. Our Rubicon offers all of the legendary rock-climbing ability of America's favorite off-roader, with a dose of comfort to go along for the ride! Print this page and call us Now...We Know You Will Enjoy Your Test Drive Towards Ownership! . All advertised prices exclude government fees and taxes, any finance charges, any dealer document preparation charge, and any emission testing charge. While we try to make sure that all prices posted here are accurate at all times, we cannot be responsible for typographical and other errors that may appear on the site. We make every effort to provide you the most accurate, up-to-the-minute information; however, it is your responsibility to verify with the Dealer that all details listed are accurate. The dealership is not responsible for typographical, pricing, product information, advertising or shipping errors. Advertised prices and available quantities are subject to change without notice. All rates and offers are dependent on bank approval, which varies based on applicant's credit as well as the vehicle.", :city=>"PHOENIX", :state=>"AZ", :zipcode=>"850086904", :category_id=>nil, :subcategory_id=>nil, :latitude=>33.699, :longitude=>-117.777, :user_id=>864, :image=>nil, :year=>2014, :miles=>39219, :transmission=>"Automatic", :color=>"Billet Metallic Clearcoat", :cylinder=>"6", :fuel=>"Gasoline Fuel", :drive=>"2WD", :address=>nil, :wholesale=>false, :price=>34995, :newused=>"Used", :vin=>"1C4BJWFG2EL127495", :stocknumber=>"127495", :model=>"Wrangler Unlimited", :trim=>"Rubicon", :enginedescription=>"Regular Unleaded V-6 3.6 L/220", :interiorcolor=>"Black", :options=>"AIR CONDITIONING W/AUTO TEMP CONTROL  -inc: Air Filtering,CONNECTIVITY GROUP  -inc: Uconnect Voice Command w/Bluetooth  Vehicle Information Center  Remote USB Port  Tire Pressure Monitoring Display,BLACK 3-PIECE HARD TOP  -inc: If ordering without AEM (Dual Top Group)  the black soft top will not be included  Rear Window Defroster  Delete Sunrider Soft Top  Freedom Panel Storage Bag  Rear Window Wiper/Washer,4.10 REAR AXLE RATIO,ENGINE: 3.6L V6 24V VVT  (STD),BLACK  CLOTH BUCKET SEATS  -inc: adjustable head restraints,MANUFACTURER'S STATEMENT OF ORIGIN,QUICK ORDER PACKAGE 24R  -inc: Engine: 3.6L V6 24V VVT  Transmission: 5-Speed Automatic (W5A580),PREMIUM BLACK SUNRIDER SOFT TOP,BILLET METALLIC CLEARCOAT,TRANSMISSION: 5-SPEED AUTOMATIC (W5A580)  -inc: Hill Descent Control  Tip Start,MAX TOW PACKAGE  -inc: Class II Receiver Hitch  Trailer Tow w/4-Pin Connector Wiring,4.10 REAR AXLE RATIO (DISCONTINUED),Four Whee