Listing.where(vin: '2C4RC1BG9HR648386').first.update(:title=>"2017 Chrysler Pacifica", :description=>"Beautiful in Brilliant Black Crystal Pearl Coat with a Black leather interior, our One Owner, Clean CarFax 2017 Chrysler Pacifica Touring-L Minivan FWD is a real game changer. Powered by a 3.6 Liter V6 that offers 287hp while connected to an innovative 9 Speed Automatic transmission. This Front Wheel Drive combination yields 28mpg along with a comfortable ride whether you're heading out on a long road trip or just around the block! This Touring-L features an elegant headlight design as well as attractive alloy wheels, luggage rack, rear spoiler, a power liftgate, and fog lights The cabin is upscale and modern with thoughtful touches including the ultra-versatile Stow 'n Go seats that allow for various cargo and seating arrangements. Amenities include power sliding doors, push-button start and stop, keyless entry, heated leather seats, and three-zone climate controls. The technology is easy to use with a Uconnect touchscreen, available satellite radio, and Bluetooth/Hands-free calling. Synonymous with safety, our Chrysler Pacifica is equipped with traction/stability control, a backup camera, automatic high-beam control headlamps, anti-lock disc brakes, advanced airbags, rear parking sensors, and even blind-spot monitoring to keep you and your precious cargo out of harm's way. With its svelte styling, luxurious interior, and impressive performance, this Pacifica is most certainly a smart choice that's more than adept at keeping your family safe and secure! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! . All advertised prices exclude government fees and taxes, any finance charges, any dealer document preparation charge, and any emission testing charge. While we try to make sure that all prices posted here are accurate at all times, we cannot be responsible for typographical and other errors that may appear on the site. We 