Listing.where(vin: '1FTFW1EF7DKD44317').first.update(:title=>"2013 Ford F-150", :description=>"Put yourself behind the wheel of this sharp and powerful Clean CarFax 2013 Ford F-150 XL SuperCrew 4WD shown in Oxford White with a Gray interior! Powered by a 5.0 Liter this V8 offers 360hp on demand while paired with a 6 Speed Automatic transmission w/Tow/Haul Mode and Four Wheel Drive. You will have no problem securing 19mpg on the highway while enjoying a smooth, quiet ride. Reliability and performance make the tough F-150 one of the top selling full-size trucks on the market today and the XL is best in class once again in towing and payload capacity. You won't be disappointed with this V8 workhorse on any terrain! The exterior is highlighted with a spray in liner, tonneau cover, tow hooks and a trailer towing package. SuperCrew offers comfortable seating for many with an easy to read modern display center and great storage spaces are all features you will enjoy. Owners like you appreciate the versatility of XL and so will you. Own a superb reliable truck that can seat six for a great price! Ford always comes through with safety and F-150 ranks at the top. It's high strength steel safety cage keeps you secure along with 6 standard airbags, rear parking aid, SOS post-crash Alert, Trailer Sway and Roll Stability control and anti-lock brakes. F-150 has everything you could ask for in a full-size truck. Whether it's for work or play you have made an excellent choice! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! . All advertised prices exclude government fees and taxes, any finance charges, any dealer document preparation charge, and any emission testing charge. While we try to make sure that all prices posted here are accurate at all times, we cannot be responsible for typographical and other errors that may appear on the site. We make every effort to provide you the most accurate, up-to-the-minute information; however, it is