Listing.where(vin: '1FTFW1ET7EFA27301').first.update(:title=>"2014 Ford F-150", :description=>"Well-equipped and completely capable, our incredible Clean CarFax 2014 Ford F-150 XLT SuperCrew 4WD is decked out in Tuxedo Black Metallic. Under the hood is a Turbo Charged 3.5 Liter EcoBoost V6 that offers 365hp on tap while paired with a 6 Speed Automatic transmission w/Tow/Haul Mode. You'll secure 21mpg on the open road while enjoying a quiet ride and experience the reliability and performance that have made the tough F-150 one of the top-selling full-size trucks on the market today. Best in class once again in towing and payload capacity and equipped with Four Wheel Drive, this workhorse always gets the job done! The formidable exterior of our XLT is highlighted by a removable tailgate with lift assist, spray in liner, keypad, tow hooks, fog lamps, trailer towing package, black wheels and a chrome grille. The cabin is durable and stylish with comfortable seating, an easy to read modern display center and great storage spaces. SYNC your phone to the AM/FM/CD stereo to become hands-free and focus on the road. This truck will feel as though it has been designed to fit your lifestyle with various modern innovations that make it a joy to drive. The interior has a rear sliding window and keyless entry. Ford always comes through with safety and F-150 ranks at the top. Its high strength steel safety cage keeps you secure along with 6 standard airbags, SOS post crash Alert, MyKey, Trailer Sway and Roll Stability control and anti-lock brakes. F-150 has everything you could ask for in a full-size truck. Whether it's for work or play, you have made an excellent choice! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership!. All advertised prices exclude government fees and taxes, any finance charges, any dealer document preparation charge, and any emission testing charge. While we try to make sure that all prices posted here are accurate at a