Listing.where(vin: '3N1CN7AP5CL946866').first.update(:title=>"2012 Nissan Versa", :description=>"Meet our incredible and efficient Clean CarFax 2013 Nissan Versa 1.6 SL Sedan. Our 1.6 SL, shown in Magnetic Gray Metallic, is the first vehicle in North America to wear the PureDrive badge, meaning it exceeds the industry average fuel economy requirements for 2016! The spunky 1.6 Liter 109hp 4-Cylinder is mated to Nissan's next-generation Xtronic CVT Automatic transmission, Front Wheel Drive and together accomplish an impressive 38mpg on the open road. Take a look at our pictures, and you'll notice the unusually roomy interior is both well built and packed with useful features. You will find air conditioning, keyless entry, a trip computer, a tilt steering wheel, an AM/FM/CD audio, an auxiliary 12V power outlet as well as a plethora of bottle and cup holders throughout. Dual-stage front airbags, side-impact airbags and roof-mounted curtain side-impact airbags are all there to keep you out of harms way in the event of an accident. To help prevent an accident, the Versa is equipped with Vehicle Dynamic Control, a Traction Control System as well as a Tire Pressure Monitoring System. These features work so well together, the Versa has been awarded a Top Safety Pick by the Insurance Institute for Highway Safety. It's time to make your daily commute greener, for both you and the environment. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! . All advertised prices exclude government fees and taxes, any finance charges, any dealer document preparation charge, and any emission testing charge. While we try to make sure that all prices posted here are accurate at all times, we cannot be responsible for typographical and other errors that may appear on the site. We make every effort to provide you the most accurate, up-to-the-minute information; however, it is your responsibility to verify with the Dealer that all details listed are accur