Listing.where(vin: '1FADP3E27FL261955').first.update(:title=>"2015 Ford Focus", :description=>"Our great looking One Owner, Clean CarFax 2015 Ford Focus S Sedan, in Oxford White, offers impressive handling, efficiency, and absolute comfort! Powered by a 2.0 Liter 4 Cylinder that delivers 160hp while connected to a 6-Speed Automatic transmission for smooth shifts and easy passing. This Front Wheel Drive handles smoothly and offers an enjoyable ride that offers near 40mpg on the highway. With fewer trips to the gas pump, you will have more time and money for the good things in life! The exterior is highlighted with Black wheels. Whether you're headed to work or play the Focus S is just simply fun to drive! Everything was designed with the driver in mind from comfortable seats, power accessories, front center storage console and plenty of head and leg room. You'll also appreciate MyKey and the SYNC voice-activated phone and audio player interface with Bluetooth, a four-speaker sound system, CD and auxiliary audio jack. The S sedan has plenty of cargo space in the trunk to keep your active lifestyle on the go with you. The Ford Focus has a great reputation for safety! Six standard airbags, electronic stability control, anti-lock brakes and tire pressure monitoring all ensure the safest ride possible. The Focus S offers everything you need for a stylish, fun, safe and economical ride. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! . All advertised prices exclude government fees and taxes, any finance charges, any dealer document preparation charge, and any emission testing charge. While we try to make sure that all prices posted here are accurate at all times, we cannot be responsible for typographical and other errors that may appear on the site. We make every effort to provide you the most accurate, up-to-the-minute information; however, it is your responsibility to verify with the Dealer that all details listed are accurat