Listing.where(vin: '2G1105S36H9162105').first.update(:title=>"2017 Chevrolet Impala", :description=>"Our great looking One Owner Clean Carfax 2017 Chevrolet Impala LT Sedan is raising the bar yet again while shown in Summit White! Fueled by a proven 3.6 Liter Direct Injected V6 that offers 305hp while paired with a 6 Speed Automatic transmission. Our Front Wheel Drive sedan rewards you with aggressive performance and incredible efficiency of near 28mpg on the highway. It's no surprise it was named Best Large Car for the Money by U.S. News and World Report! Our Impala LT boasts an athletic stance that you can't help but notice. Inside you'll discover enough space to seat five adults so you and your passengers can ride in comfort. Appreciate cloth and leatherette seating, dual-zone automatic climate control, a leather-wrapped steering wheel, an eight-way power adjustable driver seat and a trip computer. Stay effortlessly connected thanks in part to the MyLink Infotainment system, prominent touchscreen, voice controls, OnStar with available WiFi, Bluetooth, and a great sound system with available satellite radio, an SD card slot, HD radio, Apple CarPlay, and Android Auto smartphone integration. Enjoy a sterling reputation from Chevrolet for reliability and safety with anti-lock brakes, traction/stability control, advanced airbags, as well as OnStar's available automatic crash notification and emergency assistance. With ample passenger and trunk space, a wealth of amenities, and award-winning performance, our Impala is the smart choice you'll love for years to come! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! . All advertised prices exclude government fees and taxes, any finance charges, any dealer document preparation charge, and any emission testing charge. While we try to make sure that all prices posted here are accurate at all times, we cannot be responsible for typographical and other errors that may appear on the s