Listing.where(vin: 'WDDGJ4HB9DG085075').first.update(:title=>"2013 Mercedes-Benz C-Class", :description=>"Let us introduce our Clean Carfax 2013 Mercedes-Benz C250 in Black. Fast, Fun, Frugal might best describe the Turbo Charged 1.8 Liter in this coupe. Fast - 0 to 60mph in about seven seconds. Fun - the paddle shifters put you in control of gear changes plus tee-up a bonus smile when you hear the growl of the exhaust. Frugal - scoring over 30mpg when all this Fast Fun is happening! This well balanced coupe handles superbly with taught sport suspension, accelerates perfectly through 7 Speeds, and doesn't break the bank doing it. Push a button and the panoramic sunroof opens up the cabin to luxuries not always found in a sports coupe. Look at our pictures and you will see a true four seater that offers bucket seats for both front and rear passengers. Add in bold instruments housed in a metallic shroud, a huge 5.8-inch information display screen for quick system updates, and you are ready to motor. Our coupe is not only beautifully crafted but balances sport agility with amazing safety features from Mercedes-Benz inventive engineering and industry leading standards found across the Mercedes-Benz line-up. Our C250 is impeccably built to a standard befitting of its legendary status. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! . All advertised prices exclude government fees and taxes, any finance charges, any dealer document preparation charge, and any emission testing charge. While we try to make sure that all prices posted here are accurate at all times, we cannot be responsible for typographical and other errors that may appear on the site. We make every effort to provide you the most accurate, up-to-the-minute information; however, it is your responsibility to verify with the Dealer that all details listed are accurate. The dealership is not responsible for typographical, pricing, product information, advertising or s