Listing.where(vin: '1FM5K8F8XGGB42509').first.update(:title=>"2016 Ford Explorer", :description=>"Boasting legendary capability and a fresh, modern style, our family-friendly Clean Carfax 2016 Ford Explorer Limited 4WD is spectacular in White Platinum Metallic Tri-coat! This seven-passenger SUV is powered by a 3.5 Liter V6 offering 290hp on demand while paired with a responsive 6 Speed Selectshift Automatic transmission for easy passing. Our sure-footed Four Wheel Drive Explorer delivers responsive steering and smooth handling that will have you looking for reasons to get out find adventure! Upscale and bold, the stance of our Limited is enhanced with newly styled LED headlights and sleek chrome trim. You'll appreciate a hands-free power lift-gate as well as intelligent access with push-button start. Settle into heated and cooled supportive seats and check out the heated leather-wrapped steering wheel, the Sync with MyFord Touch display screen, Navigation, Bluetooth, and a Sony sound system. A 60/40 split second-row seat with heating functions and power folding 50/50 split third row offers optimal versatility for the demands of today's modern family! Explorer earned top safety ratings, and it's easy to see why. Six standard airbags, rearview camera, rear parking sensors, SOS post-crash alert, roll stability control and tire pressure monitoring are just a few of the features that keep you and your passengers safe. Abundant in style, safety, and versatility, this is an SUV that takes care of your needs! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! . All advertised prices exclude government fees and taxes, any finance charges, any dealer document preparation charge, and any emission testing charge. While we try to make sure that all prices posted here are accurate at all times, we cannot be responsible for typographical and other errors that may appear on the site. We make every effort to provide you the most accurate, up